import React from 'react';
import { useSelector } from 'react-redux';

function Card() {
  const posts = useSelector((state) => state.posts);
  console.log("Hello", posts);

  if (!posts) {
    return <div>Loading...</div>;
  }

  return (
    <div className="mx-auto">
      <div className="card" style={{ width: '18rem', margin: '7rem' }}>
        <img
          className="card-img-top"
          src="https://i.pinimg.com/236x/d6/06/4b/d6064bb81e38d01330697a134c9e0b99.jpg"
          alt="Card cap"
          style={{ height: '260px' }}
        />
        <div className="card-body">
          <h5 className="card-title">Rakesh</h5>
          <h6 className="card-title">Chahal</h6>
          <p className="card-text">rakeshchahal3233@gmail.com</p>
          <p className="card-text">Message from the system</p>
        </div>
        <div>
          {/* Map through the posts array and render each post's fname */}
          {posts.map((post) => (
            <div key={post.id}>{post.fname}</div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Card;
